import React, {useState} from "react";
import Square from "./Square";
import $ from 'jquery';

function Body() {

    const itemsList = [
        {
            imgClassName: "top",
            imgSrc: "/images/engraving.jpg",
            btnValue: "details1"
        },
        {
            imgClassName: "top",
            imgSrc: "/images/poet.jpg",
            btnValue: "details2"
        }

    ]

    return (
      <div>

        <div className="title">
            <h2>Japanese Calligraphy by Rina</h2>
        </div>

        <form action="/details" method="post">
            <div className="grid">
                {itemsList.map((item,index) => (
                    <Square 
                    key={index}
                    id={index}
                    imgClassName={item.imgClassName}
                    imgSrc={item.imgSrc}
                    btnValue={item.btnValue}
                    />
                ))}

                <div className="square">
                    <img className="side-ways" src="/images/fam_name.jpg"/>
                    <button type="submit" className="btn btn-info" name="details" value="details3" id="details">Details</button>
                </div>
                <div className="square">
                    <img className="side-ways" src="/images/miso.png"/>
                    <button type="submit" className="btn btn-info" name="details" value="details4" id="details">Details</button>
                </div>
            </div>
        </form>

        <script src="https://ajax.googleapis.com/ajax/libs/jquery/3.6.1/jquery.min.js"></script>
      </div>

    );
  }

export default Body;
